import React from "react";
import  {StyleSheet} from "react-native"
const styles =StyleSheet .create({
    container:{
        flex:1,
        marginTop:25
    },
    input:{
        borderWidth:1,
        borderColor:'blue',
        padding:15,
        fontSize:15,
        borderRadius:5,
        
    }
})
export default styles;
